import { Consumer } from '../contaxt/Contaxt'
import spinner from '../spinner/Spinner';

class Tracks extends Component {
 render() {
    return(
        <Consumer>
            {value => {
                const { track_list } = value;
                console.log(value);
                if (track_list===undefined || track_list.length===0) {
                    return <Spinner/>
                }else{}
                
            }}
        </Consumer>
        )
    }
 }
export default Tracks;
